import React, { Component } from 'react';
import { FaUsers } from 'react-icons/fa';

class Navigation extends Component {
  render() {
    const user = this.props.user
    return (
      <nav className="site-nav family-sans navbar navbar-expand bg-success navbar-dark higher">
  <div className="container-fluid">
    <a href="/" className="navbar-brand">
      <FaUsers className="mr-1"/>Meeting Log
    </a>
        <div className="navbar-nav ml-auto">
            {user && (<a className="nav-item nav-link" href="/meetings">
              Meetings
            </a>)}
            { !user && (<a className="nav-item nav-link" href="/login">
              Log In
            </a>) }
            {!user && (<a className="nav-item nav-link" href="/register">
              Register
            </a>)}
            {user && (<a className="nav-item nav-link" href="/login">
              Log Out
            </a>)}
    </div>
  </div>
</nav>
    );
  }
}
export default Navigation;
